import React, { Component } from "react";
import ReactDOM from "react-dom";
class Tick extends Component {
  constructor(props) {
    super(props);
    this.state = {
      changed: false
    };
  }

  render() {
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>;
  }

}
setInterval(Tick, 1000);
export default Tick;
